import React from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function App({ posts, loading }) {
  if (loading) {
    return <h2>...loading</h2>;
  }
  return (
    <table class="board_list_table">
      {posts.map(function (list, idx) {
        return (
          <>
            <tr class="board_list">
              <td>
                <Link
                  to={`/detail/${list[idx].id}`}
                  onClick={() => {
                    axios
                      .get(`/api/board/detail/${list[idx].id}`)
                      .then((res) => {
                        console.log(res.data);
                      });
                  }}
                >
                  {list[idx].title}
                </Link>
                <td>아이디 : {list[idx].id} ---</td>
                <td>스킬{list[idx].skillStack}</td>
                <td>분야{list[idx].workField}</td>
                <td>{list[idx].maxPeople}</td>
              </td>
            </tr>
          </>
        );
      })}
    </table>
  );
}

export default App;
